    // 按照品牌插入同品牌系列  
    let json2 = {}
    for (const item of carList) {
      if (!json2[item.brand_name]) {
        json2[item.brand_name] = {
          "index": item.index,
          "brand_id": item.brand_id,
          "brand_name": item.brand_name,
          "modelList": [
            {
              "model_id": item.model_id,
              "model_name": item.model_name
            }
          ]
        }
      } else {
        json2[item.brand_name].modelList.push({
          "model_id": item.model_id,
          "model_name": item.model_name
        })
      }

    }
    // console.log(JSON.stringify(json2))

    // 按照首字母整理
    let arr = []
    for (const key in json2) {
      let val = json2[key]
      let letter = val.index
      // 如果没有新增
      if (!arr.find(e => e && e.letter === letter)) {
        arr.push({
          "letter": letter,
          "data": [{
            "brand_id": val.brand_id,
            "brand_name": val.brand_name,
            "modelLisy": val.modelList
          }]
        })
      } else {
        // 如果有插入
        for (const item of arr) {
          if (item.letter === letter) {
            item.data.push({
              "brand_id": val.brand_id,
              "brand_name": val.brand_name,
              "modelLisy": val.modelList
            })
          }
        }
      }
